import '../CSS/Live.css'
import Questions from '../data/TCSNQT1.js'
import React, { useState , useRef } from 'react'

import { BrowserRouter as Router, Routes, Route, 
    Navigate,Link } from 'react-router-dom';


function Live() {

    const Questionslist = Questions[0].QA;
    const [count, setCount] = useState(1);
    // const [currentquestion, setCurrentquestion] = useState(1);
    const totalquestions = Questions[0].TotalQuestions;
    var currentquestion=1;

    // className={isActive =>
    //     "nav-link" + (!isActive ? " unselected" : "")
    //   }


    const next = (event) => {
        if (count < totalquestions)
            {setCount(count + 1);  
            document.getElementById("grid-item"+currentquestion).style.backgroundColor = "lightgreen";
          
            // document.getElementById("grid-item"+currentquestion).style.borderColor = "red";
          
            }

    }

    const prev = () => {
        if (count >= 2)
            setCount(count - 1);

    }

    const clear = () => {
        document.getElementById("grid-item"+currentquestion).style.backgroundColor = "#ffffffcc";
    }

    
    const linkclicked = (e) => 
    {
        var clicked =e.currentTarget.id;
        var sub=clicked.substring(9);
        setCount(sub)


    }

    function active(params)
    {
        
    } 



    const   Ref = useRef(null);


    const [timer, setTimer] = useState('00:00:00');

    const getTimeRemaining = (e) => {
        const total = Date.parse(e) - Date.parse(new Date());
        const seconds = Math.floor((total / 1000) % 60);
        const minutes = Math.floor((total / 1000 / 60) % 60);
        const hours = Math.floor((total / 1000 / 60 / 60) % 24);
        return {
            total, hours, minutes, seconds
        };
    }
  
  
    const startTimer = (e) => {
        let { total, hours, minutes, seconds } 
                    = getTimeRemaining(e);
        if (total >= 0) {
  
            // update the timer
            // check if less than 10 then we need to 
            // add '0' at the beginning of the variable
            setTimer(
                (hours > 9 ? hours : '0' + hours) + ':' +
                (minutes > 9 ? minutes : '0' + minutes) + ':'
                + (seconds > 9 ? seconds : '0' + seconds)
            )
        }
    }
  
  
    const clearTimer = (e) => {
  
        // If you adjust it you should also need to
        // adjust the Endtime formula we are about
        // to code next    
        setTimer('00:00:10');
  
        // If you try to remove this line the 
        // updating of timer Variable will be
        // after 1000ms or 1sec
        if (Ref.current) clearInterval(Ref.current);
        const id = setInterval(() => {
            startTimer(e);
        }, 1000)
        Ref.current = id;
    }
  
    const getDeadTime = () => {
        let deadline = new Date();
  
        // This is where you need to adjust if 
        // you entend to add more time
        deadline.setSeconds(deadline.getSeconds() + 10);
        return deadline;
    }




    return (

        <div className="Live">

            <div className="live-heading">
                <h2> Online Examination System</h2>
                <p className="sections" >
                    <p>Quantative</p>
                    <p>verbal</p>
                    <p>Reasoning</p>
                    <p>Time left : {timer}
                    
            <button onClick={onClickReset}>Reset</button>
                    {/* <label id="minutes"> 00</label>:<label id="seconds">00</label> */}

                    </p>
                    <p>SUBMIT</p>
                    
                </p>
            </div>

            <div className="examsection">

                <div className="questionsection" >
                    {/* <p>
                    Q1. lorem ipsum dolor sit amet, consectetur adipiscing
                </p>
                <ol type="A">
                    <li>
                        apple
                    </li>
                    <li>
                        apple
                    </li> 
                    <li>
                        apple
                    </li> 
                    <li>
                        apple
                    </li>

                </ol>
                
                 */}



                    {Questionslist.filter(q => q.No == count).map((question) => {
                        

                            // setCurrentquestion(parseInt(question.No))
                            currentquestion=question.No;
                        return (

                            <>
                            

                                <div >
                                    <p>
                                        Q{question.No}.
                                    </p>
                                    <p>{question.Q}</p>
                                </div>




                                <ol type="A">
                                    <li className="A" >
                                        {question.options[0]}
                                    </li>
                                    <li className="B">
                                        {question.options[1]}
